INSERT INTO `dev_log` VALUES ('1979758625776443393', 'OPERATE', '编辑通知公告', 'SUCCESS', NULL, '127.0.0.1', '内网IP|内网IP', 'MSEdge', 'Windows 10 or Windows Server 2016', 'vip.xiaonuo.biz.modular.notice.controller.BizNoticeController', 'edit', '/biz/notice/edit', '/biz/notice/edit', '{\"bizNoticeEditParam\":\"{\\\"id\\\":\\\"1979610287215190018\\\",\\\"title\\\":\\\"庆国庆活动荟萃\\\",\\\"image\\\":\\\"http://192.168.1.2:82/dev/file/download?id=1979758617899540481\\\",\\\"content\\\":\\\"<p><br></p><p><strong>为庆祝中华人民共和国成立72周年，南阳市社区志愿者协会，组织了一系列的迎庆活动：</strong></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">一、组织志愿者积极持续的参与创文、创卫工作。</span></p><p style=\\\\\\\"text-align: center;\\\\\\\"><img src=\\\\\\\"http://nwzimg.wezhan.cn/contents/sitefiles2051/10255538/images/25864930.jpeg\\\\\\\" alt=\\\\\\\"\\\\\\\" data-href=\\\\\\\"\\\\\\\" style=\\\\\\\"height: auto !important;\\\\\\\"></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">二、组织看望慰问孤寡残疾老人及老英模活动在持续。</span></p><p style=\\\\\\\"text-align: center;\\\\\\\"><img src=\\\\\\\"http://nwzimg.wezhan.cn/contents/sitefiles2051/10255538/images/25864919.jpeg\\\\\\\" alt=\\\\\\\"\\\\\\\" data-href=\\\\\\\"\\\\\\\" style=\\\\\\\"height: auto !important;\\\\\\\"></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">三、9月28日，南阳市社区志愿者协会人民调解委员会成立。</span></p><p style=\\\\\\\"text-align: center;\\\\\\\"><img src=\\\\\\\"http://nwzimg.wezhan.cn/contents/sitefiles2051/10255538/images/25864928.jpeg\\\\\\\" alt=\\\\\\\"\\\\\\\" data-href=\\\\\\\"\\\\\\\" style=\\\\\\\"height: auto !important;\\\\\\\"></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">四、9月29日上午，协会在卧龙区新时代文明时代中心组织庆祝中华人民共和国成立72周年舞蹈专场。</span></p><p style=\\\\\\\"text-align: center;\\\\\\\"><img src=\\\\\\\"http://nwzimg.wezhan.cn/contents/sitefiles2051/10255538/images/25864935.jpeg\\\\\\\" alt=\\\\\\\"\\\\\\\" data-href=\\\\\\\"\\\\\\\" style=\\\\\\\"height: auto !important;\\\\\\\"></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">五、9月29日下午，歌咏专场。</span></p><p style=\\\\\\\"text-align: center;\\\\\\\"><img src=\\\\\\\"http://nwzimg.wezhan.cn/contents/sitefiles2051/10255538/images/25864917.jpeg\\\\\\\" alt=\\\\\\\"\\\\\\\" data-href=\\\\\\\"\\\\\\\" style=\\\\\\\"height: auto !important;\\\\\\\"></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">六、9月30日上午有三项活动：1、“红心永向党，诵歌新时代”第六期大赛，在南阳市第十五中学举办；2、组织志愿者观看抗美援朝战斗故事片《长津湖》（30号上下午各一场、1号上午一场、2号上午一场）；3、协会爱心艺术团组织千人参与舞协在三馆一院的万人同舞庆国庆活动。</span></p><p style=\\\\\\\"text-align: center;\\\\\\\"><img src=\\\\\\\"http://nwzimg.wezhan.cn/contents/sitefiles2051/10255538/images/25864915.jpeg\\\\\\\" alt=\\\\\\\"\\\\\\\" data-href=\\\\\\\"\\\\\\\" style=\\\\\\\"height: auto !important;\\\\\\\"></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"> </p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">七、9月30日下午，协会在卧龙区新时代文明时代中心组织庆祝中华人民共和国成立72周年戏曲专场。</span></p><p style=\\\\\\\"text-indent: 37px; text-align: left;\\\\\\\"><span style=\\\\\\\"font-size: 19px; font-family: 宋体;\\\\\\\">八、几天来，协会正在筹集物资，支持南召救灾和灾后重建工作。</span></p>\\\",\\\"digest\\\":\\\"为庆祝中华人民共和国成立72周年，南阳市社区志愿者协会，组织了一系列的迎庆活动\\\",\\\"type\\\