-- ----------------------------
-- Table structure for vol_activity
-- ----------------------------
DROP TABLE IF EXISTS `vol_activity`;
CREATE TABLE `vol_activity`  (
  `ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动ID',
  `TITLE` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '活动标题',
  `COVER_IMAGE` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '封面图片URL',
  `CONTENT` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '活动详情内容（富文本）',
  `ACTIVITY_DATE` date NULL DEFAULT NULL COMMENT '活动日期',
  `START_TIME` time NULL DEFAULT NULL COMMENT '开始时间',
  `END_TIME` time NULL DEFAULT NULL COMMENT '结束时间',
  `LOCATION` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '活动地点',
  `RECRUIT_COUNT` int NULL DEFAULT 0 COMMENT '招募人数',
  `SIGNED_COUNT` int NULL DEFAULT 0 COMMENT '已报名人数',
  `SERVICE_HOURS` decimal(4, 1) NULL DEFAULT 0.0 COMMENT '服务时长（小时）',
  `SIGNUP_DEADLINE` datetime NULL DEFAULT NULL COMMENT '报名截止时间',
  `CONTACT_PERSON` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '联系人',
  `CONTACT_PHONE` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '联系电话',
  `STATUS` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'DRAFT' COMMENT '活动状态：DRAFT-草稿，RECRUITING-报名中，ONGOING-进行中，ENDED-已结束，CANCELLED-已取消',
  `ORG_ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '组织ID',
  `CREATE_USER_ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '创建用户ID',
  `SORT_CODE` int NULL DEFAULT NULL COMMENT '排序码',
  `REMARK` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `EXT_JSON` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '扩展信息',
  `DELETE_FLAG` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '删除标志',
  `CREATE_TIME` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `CREATE_USER` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '创建用户',
  `UPDATE_TIME` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `UPDATE_USER` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '修改用户',
  PRIMARY KEY (`ID`) USING BTREE,
  INDEX `idx_status`(`STATUS` ASC) USING BTREE,
  INDEX `idx_activity_date`(`ACTIVITY_DATE` ASC) USING BTREE,
  INDEX `idx_org_id`(`ORG_ID` ASC) USING BTREE,
  INDEX `idx_create_time`(`CREATE_TIME` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '志愿服务活动表' ROW_FORMAT = DYNAMIC;

