-- ----------------------------
DROP TABLE IF EXISTS `vol_activity_checkin`;
CREATE TABLE `vol_activity_checkin`  (
  `ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '签到ID',
  `ACTIVITY_ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '活动ID',
  `USER_ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户ID',
  `SIGNUP_ID` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报名记录ID',
  `CHECKIN_TYPE` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'CHECKIN' COMMENT '签到类型：CHECKIN-签到，CHECKOUT-签退',
  `CHECKIN_TIME` datetime NULL DEFAULT NULL COMMENT '签到时间',
  `LOCATION` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '签到地点',
  `LOCATION_LAT` decimal(10, 6) NULL DEFAULT NULL COMMENT '签到纬度',
  `LOCATION_LNG` decimal(10, 6) NULL DEFAULT NULL COMMENT '签到经度',
  `DEVICE_INFO` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备信息',
  `PHOTO_URL` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '签到照片URL',
  `REMARK` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `STATUS` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'NORMAL' COMMENT '状态：NORMAL-正常，LATE-迟到，EARLY_LEAVE-早退，ABSENTEEISM-旷工',
  `CREATE_TIME` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `CREATE_USER` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '创建用户',
  `checkout_time` datetime NULL DEFAULT NULL COMMENT '签退时间（自动或手动）',
  `actual_hours` decimal(5, 2) NULL DEFAULT NULL COMMENT '实际服务时长（小时）',
  `is_early_leave` tinyint(1) NULL DEFAULT 0 COMMENT '是否提前离开（0-否，1-是）',
  `checkout_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'AUTO' COMMENT '签退类型：AUTO-自动签退，MANUAL-手动签退',
  PRIMARY KEY (`ID`) USING BTREE,
  INDEX `idx_activity_user`(`ACTIVITY_ID` ASC, `USER_ID` ASC) USING BTREE,
  INDEX `idx_checkin_time`(`CHECKIN_TIME` ASC) USING BTREE,
  INDEX `idx_signup_id`(`SIGNUP_ID` ASC) USING BTREE,
  INDEX `idx_checkout_time`(`checkout_time` ASC) USING BTREE,
  INDEX `idx_checkout_type`(`checkout_type` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '志愿活动签到签退表（支持自动签退）' ROW_FORMAT = DYNAMIC;

